BATCH_SIZE = int(os.getenv('CODESEARCH_EMBEDDINGS_GPU_BATCH_SIZE', '16'))


def pick_device() -> str:
    if DEVICE_PREF != 'auto':
        return DEVICE_PREF
    if torch.cuda.is_available():
        return 'cuda'
    if hasattr(torch.backends, 'mps') and torch.backends.mps.is_available():
        return 'mps'
    return 'cpu'


DEVICE = pick_device()
MODEL = SentenceTransformer(DEFAULT_MODEL, device=DEVICE, trust_remote_code=True)
DIMS = MODEL.get_sentence_embedding_dimension()

app = FastAPI()


class EmbedRequest(BaseModel):
    input: list[str]


@app.get('/health')
def health():
    return {
        'device': DEVICE,
        'model': DEFAULT_MODEL,
        'dims': DIMS,
    }


@app.post('/embed')
def embed(req: EmbedRequest):
    embeddings = MODEL.encode(
        req.input,
        normalize_embeddings=True,
        batch_size=BATCH_SIZE,
        convert_to_numpy=True,
        show_progress_bar=False,
    )
    return {
        'embeddings': embeddings.tolist(),
        'device': DEVICE,
        'dims': DIMS,
    }


def watch_parent():
    """Exit if the parent process dies."""
    ppid = os.getppid()
    if ppid == 1:
        return  # Already orphaned or running in a container
    while True:
        try:
            os.kill(ppid, 0)
        except OSError:
            # Parent process is gone
            os._exit(0)
        time.sleep(2)


